/*

select
rownum || ':`select ' || atc.column_name || ', count(*) cnt from ' || atc.table_name || ' atc' ||
' where '|| atc.column_name || ' is not null and not exists (select 1 from ' || dee.table_name || ' tn where atc.' || atc.column_name || ' = ' || dee.column_name || ') group by atc.' || atc.column_name || ';`' q

--, atc.column_name dee.table_name tn, dee.column_name cn,
from all_tab_columns atc
left join (
  select b.table_name, b.column_name from all_constraints a
  left join all_cons_columns b
  on a.owner = b.owner and a.constraint_name = b.constraint_name
  where a.owner = 'CISADM'
  and a.table_name like 'W1_%'
  and a.constraint_type = 'P'
  and exists (
    select 1 from (
      select b.table_name, count(*) cnt from all_constraints a
      left join all_cons_columns b
      on a.owner = b.owner and a.constraint_name = b.constraint_name
      where a.owner = 'CISADM'
      and a.table_name like 'W1_%'
      and a.constraint_type = 'P'
      group by b.table_name order by 2
    ) x where cnt= 1
    and b.table_name = x.table_name
  )
) dee
on dee.column_name = atc.column_name
where atc.owner = 'CISADM'
and atc.table_name like 'W1%'
and atc.table_name not like '%_K'
and atc.table_name not like 'W1Z%'
and atc.column_name != 'BUS_OBJ_CD'
and atc.column_name != 'MAINT_OBJ_CD'
and dee.table_name not like '%VW' --not a view
and atc.table_name not like '%VW' --not a view
and dee.table_name is not null;

*/

